import React, {useState} from 'react';
import { Text, TextInput } from 'react-native';

const SearchResult = () => {
    const [value, onChangeText] = useState('Useless Placeholder');

    return (
        <>
            <Text>Search</Text>
            <TextInput
                onChangeText={text => onChangeText(text)}
                value={value}
            />
        </>
  );
}

export default SearchResult;
